    <text id="유동적인_화면_영역_왼쪽메뉴를_유동적으로_제공하는_경우_Columns의_수는_고정값으로_제공하며_Columns의_넓이는_유동적으로_제공합니다." data-name="유동적인 화면 영역
왼쪽메뉴를 유동적으로 제공하는 경우 Columns의 수는 고정값으로 제공하며 Columns의 넓이는 유동적으로 제공합니다." class="cls-11" transform="translate(169.25 1316)"><tspan class="cls-12"><tspan x="0" y="0">유동적인 화면 영역</tspan></tspan><tspan class="cls-13"><tspan x="0" y="40">왼쪽메뉴를 유동적으로 제공하는 경우 Columns의 수는 고정값으로 제공하며 Columns의 넓이는 유동적으로 제공합니다.</tspan></tspan></text>
    <text id="폰트컬러_" data-name="폰트컬러
    " class="cls-14" transform="translate(169.25 2704)"><tspan x="0" y="0">폰트컬러</tspan><tspan class="cls-15"><tspan x="0" y="40" xml:space="preserve">  </tspan><tspan class="cls-16" y="40" xml:space="preserve">  </tspan></tspan></text>
    <text id="인터랙션_컬러_interaction_color_인터렉션컬러는_디폴트컬러에서_1_2톤_밝고_어두운_컬러를_사용하는_것을_제안합니다._마우스_호버시_색상을_인터랙션_컬러_lighten_darken_를_활용하여_사용자가_어느_위치에_마우스를_호버하고_있는지_알기_쉽게_도와_줄_수_있습니다._" data-name="인터랙션 컬러(interaction color)
인터렉션컬러는 디폴트컬러에서 1~2톤 밝고 어두운 컬러를 사용하는 것을 제안합니다. 마우스 호버시 색상을 인터랙션 컬러 lighten,darken 를 활용하여 사용자가 어느 위치에 
마우스를 호버하고 있는지 알기 쉽게 도와 줄 수 있습니다.        " class="cls-11" transform="translate(169.25 3040)"><tspan class="cls-12"><tspan x="0" y="0">인터랙션 컬러(interaction color)</tspan></tspan><tspan class="cls-13"><tspan x="0" y="40">인터렉션컬러는 디폴트컬러에서 1~2톤 밝고 어두운 컬러를 사용하는 것을 제안합니다. 마우스 호버시 색상을 인터랙션 컬러 lighten,darken 를 활용하여 사용자가 어느 위치에 </tspan><tspan x="0" y="80" xml:space="preserve">마우스를 호버하고 있는지 알기 쉽게 도와 줄 수 있습니다.      </tspan><tspan class="cls-17" y="80" xml:space="preserve">  </tspan></tspan></text>
    <text id="폰트_크기_및_두께_폰트는_노토산스_폰트를_기준으로_하며_텍스트의_두께는_웹폰트_사용시_로딩시간을_고려해_최대_4개_Light_Regural_Bold_ExtraBold_까지_제한합니다._" data-name="폰트 크기 및 두께
폰트는 노토산스 폰트를 기준으로 하며, 텍스트의 두께는 웹폰트 사용시 로딩시간을 고려해 최대 4개(Light/Regural/Bold/ExtraBold)까지 제한합니다.    " class="cls-11" transform="translate(169.25 4231)"><tspan class="cls-12"><tspan x="0" y="0">폰트 크기 및 두께</tspan></tspan><tspan class="cls-13"><tspan x="0" y="40" xml:space="preserve">폰트는 노토산스 폰트를 기준으로 하며, 텍스트의 두께는 웹폰트 사용시 로딩시간을 고려해 최대 4개(Light/Regural/Bold/ExtraBold)까지 제한합니다.  </tspan><tspan class="cls-17" y="40" xml:space="preserve">  </tspan></tspan></text>
    <text id="엠프티_스테이트_Empty_states_엠프티_스테이트는_사용자에게_표시할_데이터가_없는_경우에_제공합니다._사용자가_페이지_진입_시_해당_페이지의_데이터가_삭제되었거나_사용할_수_없는_경우에_사용할_수_있습니다._" data-name="엠프티 스테이트 (Empty states)
엠프티 스테이트는 사용자에게 표시할 데이터가 없는 경우에 제공합니다.
사용자가 페이지 진입 시 해당 페이지의 데이터가 삭제되었거나 사용할 수 없는 경우에 사용할 수 있습니다.
    " class="cls-11" transform="translate(169.25 11268.424)"><tspan class="cls-12"><tspan x="0" y="0">엠프티 스테이트 (Empty states)</tspan></tspan><tspan class="cls-13"><tspan x="0" y="40">엠프티 스테이트는 사용자에게 표시할 데이터가 없는 경우에 제공합니다.</tspan><tspan x="0" y="80">사용자가 페이지 진입 시 해당 페이지의 데이터가 삭제되었거나 사용할 수 없는 경우에 사용할 수 있습니다.</tspan><tspan x="0" y="120" xml:space="preserve">  </tspan><tspan class="cls-17" y="120" xml:space="preserve">  </tspan></tspan></text>
    <text id="폼_Forms_폼은_데이터를_제공하거나_옵션을_구성할_수_있는_구성_요소들을_그룹화하여_제공합니다._폼은_가능한_3라인_이상_넘어가지않게_합니다._" data-name="폼 (Forms)
폼은 데이터를 제공하거나 옵션을 구성할 수 있는 구성 요소들을 그룹화하여 제공합니다.
폼은 가능한 3라인 이상 넘어가지않게 합니다.
    " class="cls-11" transform="translate(169.25 11994.455)"><tspan class="cls-12"><tspan x="0" y="0">폼 (Forms)</tspan></tspan><tspan class="cls-13"><tspan x="0" y="40">폼은 데이터를 제공하거나 옵션을 구성할 수 있는 구성 요소들을 그룹화하여 제공합니다.</tspan><tspan x="0" y="80">폼은 가능한 3라인 이상 넘어가지않게 합니다.</tspan><tspan x="0" y="120" xml:space="preserve">  </tspan><tspan class="cls-17" y="120" xml:space="preserve">  </tspan></tspan></text>
    <text id="로그인_Login_사용자는_로그인_페이지를_통해_ID와_비밀번호를_입력_시_서비스에_진입할_수_있습니다._사용자가_자발적으로_로그아웃하거나_활동하지_않은_시간이_길어_로그아웃_되는_경우_다시_로그인_화면을_제공할_수_있습니다._" data-name="로그인 (Login)  
사용자는 로그인 페이지를 통해 ID와 비밀번호를 입력 시 서비스에 진입할 수 있습니다.
사용자가 자발적으로 로그아웃하거나 활동하지 않은 시간이 길어 로그아웃 되는 경우 다시 로그인 화면을 제공할 수 있습니다.
    " class="cls-11" transform="translate(169.25 12346.377)"><tspan class="cls-12"><tspan x="0" y="0" xml:space="preserve">로그인 (Login)  </tspan></tspan><tspan class="cls-13"><tspan x="0" y="40">사용자는 로그인 페이지를 통해 ID와 비밀번호를 입력 시 서비스에 진입할 수 있습니다.</tspan><tspan x="0" y="80">사용자가 자발적으로 로그아웃하거나 활동하지 않은 시간이 길어 로그아웃 되는 경우 다시 로그인 화면을 제공할 수 있습니다.</tspan><tspan x="0" y="120" xml:space="preserve">  </tspan><tspan class="cls-17" y="120" xml:space="preserve">  </tspan></tspan></text>
    <text id="팝업_Popup_팝업의_크기는_내용에_따라_확장_될_수_있습니다._메세지_내용이_길어지거나_추가_기타_요소가_제공되는_경우_팝업의_크기는_확장되어_제공_될_수_있습니다." data-name="팝업 (Popup)
팝업의 크기는 내용에 따라 확장 될 수 있습니다. 메세지 내용이 길어지거나 추가 기타 요소가 제공되는 경우 팝업의 크기는 확장되어 제공 될 수 있습니다." class="cls-11" transform="translate(169.25 13049.377)"><tspan class="cls-12"><tspan x="0" y="0">팝업 (Popup)</tspan></tspan><tspan class="cls-13"><tspan x="0" y="40">팝업의 크기는 내용에 따라 확장 될 수 있습니다. 메세지 내용이 길어지거나 추가 기타 요소가 제공되는 경우 팝업의 크기는 확장되어 제공 될 수 있습니다.</tspan></tspan></text>

현재 날짜가 기본적으로 표시되어 있습니다.
